import React from 'react';
import {useNavigate} from "react-router-dom"

const AboutPage = () => {

    const nav = useNavigate()

    function goHome() {
        nav('/')
    }

    return (
        <div>
            <button onClick={goHome}>Go To Home page</button>
        </div>
    );
};

export default AboutPage;
